// Solution 1:
const moveElementToEnd = (arr, toMove) => {
    let left = 0;
    let right = arr.length - 1;

    while(left < right){
        if(arr[right] === toMove && arr[left]!== toMove){
            [arr[left], arr[right]] = [arr[right], arr[left]];
            left++;
            right--;
        } else if(arr[right]!== toMove){
            right--;
        } else if(arr[left] === toMove){
            left++;
        }
    }

    return arr;
}

console.log(moveElementToEnd(['a', 'd', 'd', 'd', 'd', 'a', 'a', 'i', 'a'], 'a')) // ['a', 'a', 'a', 'd', 'd', 'd', 'd', 'i', 'a']
console.log(moveElementToEnd(['g', 'g', 'g', 'g', 'g', 'a', 'a', 'i', 'a'], 'a')) // ['a', 'a', 'g', 'g', 'g', 'g', 'g', 'i', 'a']
